.custom-card {
            border-radius: 15px;
            font-size: 0.8rem;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .custom-card:hover {
            transform: translateY(-10px);
            box-shadow: 0 8px 16px rgba(0, 0, 0, 0.6);
        }

        .custom-card-header {
            color: black;
            font-size: 1.2rem;
            font-weight: bold;
            text-align: center;
        }

        .custom-card-body {
            background-color: #f8f9fa;
            padding: 20px;
            color: #333;
        }

        .custom-card-footer {
            background-color: #f8f9fa;
            text-align: center;
            padding: 10px;
            border-bottom-left-radius: 15px;
            border-bottom-right-radius: 15px;
        }

        .custom-card img {
            border-radius: 15px;
        }

