function checkPosts(){
    $.get("$val(BASE_URL)/contents/node/code/CONTENTS--1739396465006?payloadOnly=true", function(data, status){
     console.log(data);
     if(data && data.length > 0){
        $('#posts').html("");
         data.forEach(post=>{
             if(post.title){
                $('#posts').append('<div class="container mt-5"><div class="custom-card"  style="margin-bottom: 50px;">'+ 
                    '<div class="custom-card-header">'+post.title+'</div>'+
                '<img src="$val(BASE_URL)/contents/code/'+post.picture+'/file" class="card-img-top">'+
                '<div class="custom-card-body">'+post.content+'</div></div></div>');
             }
         });
     }
    });
}

$(document).ready(function() {
  setInterval(function() {
    checkPosts();
  }, 30000);
});

checkPosts();
